import React, { Component } from "react";
import Button from "./Button";
import TimerForm from "./TimerForm";

class ActionContainer extends Component {
  render() {
    if (this.props.isFormOpen) {
      return <TimerForm />;
    } else {
      return <Button />;
    }
  }
}
export default ActionContainer;
